  const [showSearchPage, setShowSearchpage] = useState(false);

  return (
    <div className="app">
          <div className="open-search">
            
            
              <Route exact path="/search" element={
                  <SearchComponent  />
                }
              />
             
           
          </div>
    </div>
  );
}

export default App;
